import React from 'react';

import Header from '../images/Header_programing.jpg';

class Badge extends React.Component {
  render() {
    return <div>
        <div>
          <img src="{Header}" alt="cabecera de presentación" />
        </div>
        <div>
          <img src="" alt="Lucía Sánchez Hernández SEO y Frontend" />
          <h1>Lucía A. <br/> Sánchez H.</h1>
        </div>
        <div>
          <p>SEO Specialist and Junior Front-end Developer</p>
          <p>@Lu_San2</p>
        </div>
        <div>
          <p>#ReactLover</p>
        </div>
    </div>
  }
}

export default Badge;
